import React from 'react';

export default function ThirdFloorQuestions() {
  return (
    <div>
      <h1 style={{ fontSize: '35px', fontWeight: 'bold', padding: '15px', marginTop: '30px', marginBottom: '20px', textAlign: 'center' }}>Third Floor Rental</h1>
      <div style={{ borderWidth: '4px', borderStyle: 'solid', marginLeft: '30px', marginRight: '30px', borderColor: 'black' }}>
        <label style={{ margin: '20px', color: 'orange', fontSize: '20px', display: 'block' }}>What is the name of your Business / Organization</label>
        <input placeholder='input:' style={{ padding: '5px', margin: '20px', borderWidth: '1px', borderColor: 'grey', display: 'block' }} />

        <label style={{ margin: '20px', color: 'orange', fontSize: '20px', display: 'block' }}>Expected Attendance</label>
        <input placeholder='input:' style={{ padding: '5px', margin: '20px', borderWidth: '1px', borderColor: 'grey', display: 'block' }} />

        <label style={{ margin: '20px', color: 'orange', fontSize: '20px', display: 'block' }}>Do you have any requests regarding our catering menu?</label>
        <input placeholder='input:' style={{ padding: '5px', margin: '20px', borderWidth: '1px', borderColor: 'grey', display: 'block' }} />

        <label style={{ margin: '20px', color: 'orange', fontSize: '20px', display: 'block' }}>Do you have any requests regarding our catering menu?</label>
        <input placeholder='input:' style={{ padding: '5px', margin: '20px', borderWidth: '1px', borderColor: 'grey', display: 'block' }} />
      </div>
    </div>
  );
}
